import { UserListItem } from "./UserListItem";
import { UserType } from "../main/types";

type Props = {
  users: UserType[];
};

export function UserList({ users }: Props) {
  return (
    <ul className="user-list">
      {users.map((user) => (
        <UserListItem user={user} />
      ))}
    </ul>
  );
}
